import React, { Component } from 'react';

class LinkSection extends React.Component {
    state = {
        isSelected: false,
    }

    render() {
        var classname = "Meoi-link";
        return <div><a
        className={classname}
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        {this.props.headerText}
      </a></div>;
    }
  }

export default LinkSection;
